import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';


function NavigationItems() {

    return (
        <Container>
            <Row>
                <Col xs={2} id="sidebar-wrapper">
                    <p>SideBar</p>
                </Col>
                <Col xs={10} id="page-content-wrapper">
                    <p>This is a test</p>
                </Col>
            </Row>
        </Container>
      );
}

export default NavigationItems;
